import React from "react";

const Leftbar = () => {
  return (
    <div className="leftbar">
      <div className="container">
        <div className="menu">
          <div className="user">
            <img
              src="https://images.pexels.com/photos/3228727/pexels-photo-3228727.jpeg"
              alt=""
            />
            <span>Sham</span>
          </div>
          <div className="items">
            <img src="" alt="" />
            <span>Friends</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Leftbar;
